import React from 'react';

function HistoryRow({history}) {
  return <div>{history.map((row) => {
    return (
        <div className="row-container">
            {row.map((letter) => {
                return (
                    <div className="letter-box"><span>{letter}</span></div>
                )
            })}
        </div>
    )
})}</div>;
}

export default HistoryRow;
